    TableName = 0x0,    // WCHAR[16], 2 * 16 = 32 bytes
    //[FieldOffset(0x20)]
     /* ushort */ version = 0x20,    // WORD[4] 8 bytes
    //[FieldOffset(0x28)]
   /*  internal uint */ OffsetToCategoriesIndex = 0x28, // DWORD 4 bytes
   // [FieldOffset(0x2c)]
    /* internal uint */ OffsetToCategoriesValue = 0x2c, // DWORD 4 bytes
